import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';
import Nav from './components/Nav';

class App extends Component {
  render() {
    window.navigator.geolocation.getCurrentPosition(
      (position) => console.log(position),
      (err) => console.log(err)
    );
    return (
      <div className="App">
        <Nav />
      </div>
    );
  }
}

export default App;
